import * as React from "react";
import FoodCard from "./FoodCard";
import { useState } from "react";
import Feed from "../../interfaces/Feed";

interface CardGroup {
  isMyCards: boolean;
}

function CardGroup(props: CardGroup) {
  const myFeeds: Feed[] = [
    {
      id: 1,
      title: "title",
      description: "description",
      numberOfVideosPerRequest: 1,
      sourceLinks: ["link1", "link2"],
      keyword: "keyword",
    },
  ];

  const [feeds, setFeeds] = useState(myFeeds);
  return (
    <div className="container">
      <div
        className="row d-flex justify-content-center"
        style={{ textAlign: "center" }}
      >
        {feeds.map((el, ind) => {
          return (
            <FoodCard
              id={ind}
              key={ind}
              title={el.title}
              description={el.description}
              numberOfVideosPerRequest={el.numberOfVideosPerRequest}
              keyword={el.keyword}
              sourceLinks={el.sourceLinks}
            />
          );
        })}
      </div>
      <button className="custom-round-button" style={{position: "absolute", bottom: "100px", right: "100px"}}>
        <div
          className="d-flex align-items-center justify-content-center"

        >
          +
        </div>
      </button>
    </div>
  );
}

export default CardGroup;
